import styled from 'styled-components'

export const StyledDetailPage = styled.div`
    height: 100vh; 
    display: flex; 
    flex-direction: column; 
    justify-content: center; 
    align-items: center; 

    div{
        width: 400px; 
        display: flex; 
        justify-content: space-between; 
        margin: 20px 0px; 
    }
    tr{
        background: green; 
        width: 900px; 
    }
`
